import React from "react";

const Info = ({ points, rebounds, assists, avgFG, avgThree, avgFree }) => {
  return (
    <div className="info">
      <div className="left">
        <ul>
          <li>{points} total PPG</li>
          <li>{rebounds} total RPG</li>
          <li>{assists} total APG</li>
          <li>{avgFG}%</li>
          <li>{avgThree}%</li>
          <li>{avgFree}%</li>
        </ul>
      </div>
      <div className="right">
        <h1 className="grade">A+</h1>
      </div>
    </div>
  );
};

export default Info;
